INSERT INTO `espectaculo` VALUES (33,'23 febrero 2022 Drag Fura abrirá el Concurso Nacional de Drag Queen \"Tomás Bravo\" que se celebrará el próximo lunes, 28 de febrero, dentro del Carnaval Romano de Mérida. Así pues, la delegada de Diversidad LGTBI del Ayuntamiento de Mérida, Pilar Amor, ha presidido este miércoles el sorteo para determinar el orden de actuación de los cinco participantes que presentarán sus fantasías en dicho evento, en la carpa de la Plaza de España. Según sus palabras, \"todo un espectáculo\" que contará con la presentación de la periodista Olga Ayuso y que estará acompañada por Drag Neca, que arrancará la gala con el espectáculo \"Bienvenidos al Carnaval\" y que darán paso a las actuaciones, ordenadas según sorteo, de Drag Fura, que presentará la fantasía \"Gorgona pero Mona\", Drag Pandora tu caja de sorpresas con la fantasía \"La suerte de la fea, la guapa la desea\", Drag Deseo, con \"De guerreras a villanas esta Drag Trans viene con ganas\", Drag Istérica Konfundida, con la fantasía \"Mérida, tierra de Dioses\" y Drag Lore Çe Pum con la fantasía \"Manosea tus raíces\". Tras el descanso del espectáculo, los asistentes podrán disfrutar de la actuación de Priscila Osiris y Lolita Pin-Up con el espectáculo I love 89 y 90 y, cerrando la gala, la actuación de la Academia de baile Wabi Sabi\", según informa el Ayuntamiento emeritense en una nota de prensa.',34,'Drag Queen Tomás Bravo','950','data:image/jpeg;base64,'),(36,'Los veinte componentes de este grupo torremolinense, dirigido por Alfonso López Rubio, recibieron el galardón de manos del alcalde, Pedro Fernández Montes, siendo la primera ocasión en la que un colectivo local se alza con el triunfo en la trayectoria del Campeonato de Europa de Baile. La ejecución del número comenzó con un reconocimiento al baile típico de Wollywood, incorporando pinceladas de salsa, bailemoderno y lírica en una pieza espectacular con rasgos elegantes, color y sensibilidad. El jurado respaldó el paso a la Gran Final de “Sabalba”. López Rubio es un veterano participante en el Campeonato de Europa de Baile. Como pareja cuenta en sus vitrinas con el título de Campeón de Europa de Baile Combinado de 2011, y en esta misma edición ha sido tercero de Europa en la misma modalidad y subcampeón en la modalidad de Rock & Roll.',34,'Farida Faiza','500','data:image/jpeg;base64,'),(37,'El Tango es un baile de origen Argentino que surge de la fusión cultural de inmigrantes europeos, descendientes de esclavos africanos y nativos de la región del Río de la Plata. Esta mezcla es muy enriquecedora, y es visible tanto en el lenguaje utilizado en las letras como en la mezcla de géneros musicales que dan origen a la música del Tango.\n\nEste estilo de baile se fue formando en los barrios de trabajadores, es un estilo muy urbano que surge en la calle. Los temas de sus letras, son temas cotidianos entre los que priman los desengaños amorosos como tema central.\n\nEl Tango es un baile de salón muy elegante que se baila en pareja y que ahora puedes aprender en Le Bal. Este verano ven y disfruta de la música argentina.\n\nEl tango llegó cuando era muy chico. Yo me iba con mis padres a los salones en donde solían ir a bailar. No eran los salones de ahora, no había mesas adentro, los salones estaban adentro y la confitería afuera. Y así poco a poco empecé a bailar los primeros pasos, siguiendo a mi madre y después mirando a los grandes bailarines de ese entonces, yo tendría 8 o 10 años; ya llegando a los 18 o 19 años, continué aprendiendo mirando a diferentes bailarines.\n\n«Era muy lindo verlos bailar a mis viejos, tenían un estilo salón muy, muy lindo. En esa época, te puedo garantizar que prácticamente no había maestros de tango, entre nosotros nos juntábamos los lunes o miércoles, que los teníamos reservados para bailar y ensayábamos y practicábamos pasos diferentes. Estaba Gavito, Juan Carlos Copes, mucha gente conocida. Estaba también Carlos Pérez. Son infinidad de nombres que te podría dar de los que concurríamos ahí',32,'Tango argentino','150','data:image/jpeg;base64,');
