INSERT INTO `usuario` VALUES (32,'Daniel','García','danielg@art.com','c/La fuente nº45, Córdoba','daniG','234-123-123','$2a$10$c8dcW.ZxewGhJAzlN2wo/uC1HLWD/et0Su5KC7bSe5W5QFCCZVYBy','1986-05-15','Baile de salón','Cuando era pequeño, veía a los bailarines por televisión y me gustaba mucho bailar. Mi madre me apuntó entonces a una escuela y empecé a bailar flamenco y a hacer exhibiciones. Luego decidí cambiar de estilo y me decanté por los bailes de salón y a partir de ahí empezó mi trayectoria.\nEstábamos en una escuela y yo sabía que ellos participaban en campeonatos. Me llamaba mucho la atención por el tema del vestuario y el hecho de ir a competiciones fuera de España. Por eso también me decanté más por los bailes de salón porque con el flamenco no se hacía nada más que los mayos de Córdoba o la feria.\n\nEl baile de salón tiene muchas variantes, como los bailes latinos y los bailes estándar. Los bailes latinos son la bachata, el cha-cha-chá, el rock and roll, y luego los bailes estándar son el folk rock o el vals. Es muy diferente por el tema del vestuario sobre todo.','','data:image/jpeg;base64,'),(33,'Joaquín','López','joaquinl@emp.com','C/Laguna Nº18, Baena','JoaquinL','985-852-852','$2a$10$b8skLXgrqY1onZv6yvi2IuUR6qtHuMsGTiRj1kWNnOVN2YwOFO.fu','1968-07-18','','','Ayuntamiento de Baena','data:image/jpeg;base64,'),(34,'Alfonso','López Rubio','alf@art.com',' c/piedra nº 15, puebla de la calzada','alfloprub','952-841-963','$2a$10$64o6pTbklb/4cMFzr8QOAuTZolOehpP50Gs2sFtm1ggFwcUEzYJ3K','1985-06-04','Baile de salón','Desde pequeño le ha gustado el Arte y la Danza montando sus propias coreografías en su habitación. En Mérida, cursa Bachillerato de Artes y en Málaga, la carrera de Artes Escénicas. Se inicia junto a su amigo Jesús con los montajes de Baile escolares, pasa a recorrer los escenarios con el grupo Jarancio bailando las canciones del momento y se forma en clases de Bailes de Salón. En su haber cuenta con más de cien premios en competiciones de Baile, siendo campeón Europeo en Bailes de Salón y en Formaciones. Ha aparcado, momentáneamente el mundo de las Drag Queen, en el que adopta el nombre artístico de Drag Debú, por la televisión. En el 2015 participa en el programa de televisión “Tu cara me suena.” Después en el programa “Tu cara no me suena todavía”y en “Bailando con las estrellas” en calidad de Asistente de Coreografía. Está implicado con el colectivo LGTBI y desde Madrid vuelve siempre que puede a su Puebla de la Calzada.','','data:image/jpeg;base64,');
